import React from 'react';
import {socket} from "../service/socket";

class Game extends React.Component {
  componentDidMount() {
    socket.on('toggle screen', (s) => {
      console.log('Test')
      document.body.style.backgroundColor = 'green';
    })
  }

  render() {
    return (
      <div style={{ textAlign: "center" }}>
        Game Screen
      </div>
    );
  }
}

export default Game;
